sys_variable_value.value:
var now = new Date();
var timeToStop = workflow.scratchpad.wait_until_time;

if (now.getTime() - timeToStop > 0) {
	workflow.scratchpad.error_messages += 'Billing download timed out.';
	answer = 'yes';
} else {
	answer = 'no';
}

var now = new Date();
var timeToStop = workflow.scratchpad.wait_until_time;

if (now.getTime() - timeToStop > 0) {
	workflow.scratchpad.error_messages += 'Billing download timed out.';
	answer = 'yes';
} else {
	answer = 'no';
}

var rowsRemaining = 1;

var gr = getNextResult();
var joinedOutput = '';
var pageCount = 0;

while (gr.next()) {
	workflow.scratchpad.last_sequence = gr.sequence+'';
	var payload = gr.payload+'';
	if (payload == '<see_attachment/>') {
        payload = getAttachmentData(gr)+'';
	}
	var resultIndex = payload.indexOf("<result><output>");
	if (resultIndex >= 0) {
		var output = payload.substring(resultIndex+16,
						payload.indexOf("</output></result>"));
		if (output == 'Download complete') {
			processCSV(joinedOutput);
			workflow.scratchpad.download_complete = true;
		} else {
			if (pageCount % 2 == 0) {
				processCSV(joinedOutput);
				joinedOutput = output;
			} else {
				joinedOutput = joinedOutput+'\n'+output.substring(output.indexOf('\n')+1);
			}
				
		}
		pageCount++;
	}
	gr.state = 'processed';
	gr.processed = new GlideDateTime().getDisplayValue();
	gr.update();
	
	// Re-run query after each chunk is processed because more should be available by then
	gr = getNextResult();
}
activity.result = 'success';

function processCSV(output) {
	
	var progress = Math.floor((100.0*pageCount)/(pageCount+rowsRemaining));
	var logGr = new GlideRecord('sn_cmp_billing_job_log');
	if (logGr.get(workflow.inputs.u_log_id)) {
		logGr.details = 'Parsing downloaded data ('+progress+'%)';
		logGr.update();	
	}
	
	if (!gs.nil(output)) {
		ppGr = new GlideRecord('sn_capi_provider_property');
		ppGr.addQuery('provider', workflow.scratchpad.activityConfig.providerId);
		ppGr.addQuery('key', 'billing_processor_constructor');
		ppGr.query();
		var processor = null;
		if(ppGr.next()) {
			var evaluator = new GlideScopedEvaluator();
			processor = evaluator.evaluateScript(ppGr,'value',null);
		} else {
			activity.result = 'failure';
		}
		processor.setProperties(workflow.scratchpad.csv_processor);
		processor.process(output);
		workflow.scratchpad.csv_processor = processor;
	}
}

function getAttachmentData(record) {
  var gr, bytes;
  gr = new GlideRecord('sys_attachment');
  gr.addQuery('table_name', '=', record.getTableName());
  gr.addQuery('table_sys_id', '=', record.sys_id);
  gr.addQuery('file_name', '=', 'payload.txt');
  gr.setLimit(1);
  gr.query();
  if (gr.next()) {
	return new global.CmpImportHelper().getEccQueueAttachmentBytes(gr);
  }
  return '';
}

function getNextResult() {
	var gr = new GlideRecord("ecc_queue");
	gr.addQuery("name", workflow.scratchpad.activityConfig.probeClass);
	gr.addQuery("queue", "input");
	gr.addQuery("agent_correlator", workflow.scratchpad.agent_correlator);
	gr.addQuery("sequence", ">", workflow.scratchpad.last_sequence);
	gr.orderBy("sequence");
	gr.query();
	rowsRemaining = gr.getRowCount();
	return gr;
}

