run();

function run(){

	// find the record from job config table.
	var configGr = new GlideRecord('sn_cmp_billing_schedule');
	configGr.get(workflow.inputs.u_config_id);

	workflow.scratchpad.activityConfig = getActivityConfig(configGr);
	workflow.scratchpad.error_messages = "";
}

function getActivityConfig(configGr){
	
	var config = {};
	config.accountId = gs.nil(configGr.account) ? '' : configGr.account.sys_id;
	config.accountNum = getSvcAccountNumber(config.accountId);
	if (gs.nil(config.accountNum) && !gs.nil(configGr.credential.enrollment_number)) {
		config.accountNum = configGr.credential.enrollment_number;
	}
	config.credentialId = configGr.credential.sys_id;
	config.jobConfigId=configGr.sys_id;
	config.bucket = gs.nil(configGr.bucket) ? '(empty)' : configGr.bucket;
	config.year=workflow.inputs.u_year;
	config.month=workflow.inputs.u_month;
	config.includeZeroCostItems=workflow.inputs.u_include_zero_cost_items;
	config.masterWfContextId=workflow.inputs.u_master_wf_context;
	config.chunkSize=gs.getProperty('sn_cmp.billing.page_size', 3000000);
	
	var util = new CmpBillingJobUtil();
	config.providerName = configGr.provider.name;
	config.providerId = configGr.provider;
	config.probeClass = util.getProviderProperty(configGr.provider, 'billing_probe');
	config.endpoint = util.getProviderProperty(configGr.provider, 'billing_endpoint');
	config.reportType = util.getProviderProperty(configGr.provider, 'billing_report_type');
	config.csvProcessorInit = util.getProviderProperty(configGr.provider, 'billing_processor_constructor');
	
	var csvProcessor;
	ppGr = new GlideRecord('sn_capi_provider_property');
	ppGr.addQuery('provider', config.providerId);
	ppGr.addQuery('key', 'billing_processor_constructor');
	ppGr.query();
	if(ppGr.next()) {
		var evaluator = new GlideScopedEvaluator();
		csvProcessor = evaluator.evaluateScript(ppGr,'value',null);
	} else {
		activity.result = 'failure';
	}	
	config.includedDays = csvProcessor.getDaysToDownload(
			config.accountNum+'', config.year+'', config.month+'',
			workflow.inputs.u_clear_existing_data
	);	
	
	return config;
}

function getSvcAccountNumber(accountId){
	var gr = new GlideRecord('cmdb_ci_cloud_service_account');
	if (gr.get(accountId)) {
		return gr.account_id;
	}
	return '';
}

run();

