process();

function process() {
	workflow.scratchpad.last_sequence = '0';
	workflow.scratchpad.download_complete = false;

	ppGr = new GlideRecord('sn_capi_provider_property');
	ppGr.addQuery('provider', workflow.scratchpad.activityConfig.providerId);
	ppGr.addQuery('key', 'billing_processor_constructor');
	ppGr.query();
	if(ppGr.next()) {
		var evaluator = new GlideScopedEvaluator();
		workflow.scratchpad.csv_processor = evaluator.evaluateScript(ppGr,'value',null);
	} else {
		activity.result = 'failure';
	}

	// Allow up to one hour for MID server to stream download
	var now = new Date();
	workflow.scratchpad.wait_until_time = now.setTime(now.getTime() + (20*60*1000));
	
	var eccGr = new GlideRecord('ecc_queue');
	if (eccGr.get(data.get(12).ecc_queue)) {
		workflow.scratchpad.agent_correlator = eccGr.getValue('agent_correlator');
		workflow.scratchpad.csv_processor.config(
			workflow.scratchpad.activityConfig.accountNum,
			workflow.scratchpad.activityConfig.year,
			workflow.scratchpad.activityConfig.month,
			workflow.inputs.u_clear_existing_data
		);
	} else {
		activity.result = 'failure';
	}
}

